import { useState, useCallback } from "react";
import Frame from "./Frame";
import PortalPopup from "./PortalPopup";
import Mytrip from "./Mytrip";
import "./Navbar.css";

const Navbar = () => {
  const [isUserProfileOpen, setUserProfileOpen] = useState(false);
  const [isMytripOpen, setMytripOpen] = useState(false);

  const openUserProfile = useCallback(() => {
    setUserProfileOpen(true);
  }, []);

  const closeUserProfile = useCallback(() => {
    setUserProfileOpen(false);
  }, []);

  const openMytrip = useCallback(() => {
    setMytripOpen(true);
  }, []);

  const closeMytrip = useCallback(() => {
    setMytripOpen(false);
  }, []);

  return (
    <>
    <div style={{width: 1440, height: 133, position: 'relative', background: 'black'}}>
  <div style={{width: 100, height: 100, left: 1317, top: 17, position: 'absolute', borderRadius: 60, overflow: 'hidden', justifyContent: 'center', alignItems: 'center', display: 'inline-flex'}}>
    <img style={{width: 100, height: 100}} src="/navba" />
  </div>
  <div style={{width: 151, height: 53, left: 168, top: 26, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 50, fontFamily: 'Gurajada', fontWeight: '400', letterSpacing: 1, wordWrap: 'break-word'}}>Discover</div>
  <div style={{width: 151, height: 53, left: 369, top: 27, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 50, fontFamily: 'Gurajada', fontWeight: '400', letterSpacing: 1, wordWrap: 'break-word'}}>Trips</div>
  <div style={{width: 194, height: 53, left: 814, top: 26, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 50, fontFamily: 'Gurajada', fontWeight: '400', letterSpacing: 1, wordWrap: 'break-word'}}>Community</div>
  <div style={{width: 194, height: 53, left: 570, top: 27, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 50, fontFamily: 'Gurajada', fontWeight: '400', letterSpacing: 1, wordWrap: 'break-word'}}>My Plan</div>
</div>
    </>
  );
};

export default Navbar;
